script: |
  super -f text -I q2430.spq | sort > q2430.out

inputs:
  - name: q2430.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - col2 * col0 / - + 12 + + col0 BETWEEN col0 AND 59 / 34 + 91;
  - name: tab1

outputs:
  - name: q2430.out
    data: |
      51	14	96
      85	5	59
      91	47	68
